INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (0, 102601, 0.0, 1, "2030/12/17 14:59:59", "あたしだって\nやるときはやるよ！", 10040, 0.0, 24, 24001, 1, 0.0, "リン", "2020/04/30 12:00:00");
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (1, 102601, 0.0, 1, "2030/12/17 14:59:59", "ふぅ…\nこれであたしの仕事は\n終わりだね", 10040, 0.0, 24, 24002, 1, 0.0, "リン", "2020/04/30 12:00:00");
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (2, 102601, 0.0, 1, "2030/12/17 14:59:59", "終わった終わった\n一人でもなんとか\nなるもんだね", 10040, 0.0, 24, 24003, 1, 0.0, "リン", "2020/04/30 12:00:00");
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (3, 102601, 0.0, 2, "2030/12/17 14:59:59", "やったね！\nこれでようやく\nサボれるよ…", 10040, 0.0, 24, 24004, 2, 0.0, "リン", "2020/04/30 12:00:00");
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (4, 102601, 0.0, 1, "2030/12/17 14:59:59", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 10040, 0.0, 24, 24005, 1, 0.0, "リン", "2020/04/30 12:00:00");
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (5, 102601, 0.0, 2, "2030/12/17 14:59:59", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 10040, 0.0, 24, 24006, 2, 0.0, "リン", "2020/04/30 12:00:00");
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (6, 102601, 0.0, 2, "2030/12/17 14:59:59", "あたしも意外と\nやるもんでしょ？", 10040, 0.0, 24, 24007, 2, 0.0, "リン", "2020/04/30 12:00:00");
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (7, 102601, 0.0, 4, "2030/12/17 14:59:59", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 10040, 0.0, 24, 24008, 4, 0.0, "リン", "2020/04/30 12:00:00");
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (8, 102601, 0.0, 4, "2030/12/17 14:59:59", "このままじゃ\nまっひ～に\n叱られちゃうよ", 10040, 0.0, 24, 24009, 4, 0.0, "リン", "2020/04/30 12:00:00");
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (9, 102601, 0.0, 4, "2030/12/17 14:59:59", "まじめに\nやったんだけどな…\n悔しいな～", 10040, 0.0, 24, 24010, 4, 0.0, "リン", "2020/04/30 12:00:00");
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (10, 102601, 0.0, 4, "2030/12/17 14:59:59", "やられた…\nねずみって意外と\nてごわいね", 10040, 0.0, 24, 24011, 4, 0.0, "リン", "2020/04/30 12:00:00");
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (11, 102601, 0.0, 4, "2030/12/17 14:59:59", "おのれ～\nあたしのチーズを\n盗みやがって～！", 10040, 0.0, 24, 24012, 4, 0.0, "リン", "2020/04/30 12:00:00");
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (12, 102601, 1.81, 4, "2030/12/17 14:59:59", "疲れた…\nけど、次こそは\n守り抜くよ…", 10040, 0.0, 24, 24013, 1, 0.0, "リン", "2020/04/30 12:00:00");
